import React from 'react';

const Footer = props => (
    <div className="footer">
        <footer id="footer">
            <small>&copy; Copyright 2020, Vadim Stakhnyuk</small>
        </footer>
        <div class="backtotop">
            <div class="backtotop-morph"></div>
        </div>
    </div>
)

export default Footer;
